import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Navbar from './Navbar';
import '../styles/global.css'; // 스타일 연결

const Signup = () => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    password: '',
    profileImage: null,
  });

  // 입력 필드 변경 핸들러
  const handleChange = (e) => {
    if (e.target.name === 'profileImage') {
      setFormData({ ...formData, profileImage: e.target.files[0] });
    } else {
      setFormData({ ...formData, [e.target.name]: e.target.value });
    }
  };

  // 회원가입 요청
  const handleSubmit = async (e) => {
    e.preventDefault();
    const data = new FormData();
    data.append(
      'memberDTO',
      JSON.stringify({
        username: formData.username,
        email: formData.email,
        password: formData.password,
      })
    );
    if (formData.profileImage) {
      data.append('authImgFile', formData.profileImage);
    }

    const response = await fetch('https://sequence-php.agong.store/api/users/join', {
      method: 'POST',
      body: data,
    });

    const result = await response.json();
    alert(result.message);
    if (result.message === '회원가입 성공!') navigate('/login');
  };

  return (
    <div>
      <Navbar />
      <section className="auth-container">
        <h1>회원가입</h1>
        <p>필수 정보를 입력해주세요</p>
        <form className="signup-form" onSubmit={handleSubmit}>
          {/* 기본 정보 */}
          <div className="form-section">
            <h2>기본 정보</h2>
            <div className="form-group">
              <label>이름</label>
              <input type="text" name="username" placeholder="이름을 입력하세요." onChange={handleChange} />
            </div>
            <div className="form-group">
              <label>생년월일</label>
              <input type="date" name="birth" onChange={handleChange} />
            </div>
            <div className="form-group">
              <label>성별</label>
              <select name="gender" onChange={handleChange}>
                <option value="M">남성</option>
                <option value="F">여성</option>
              </select>
            </div>
            <div className="form-group">
              <label>휴대전화 번호</label>
              <input type="text" name="phone" placeholder="010-1234-5678" onChange={handleChange} />
            </div>
            <div className="form-group">
              <label>이메일</label>
              <input type="email" name="email" placeholder="이메일을 입력하세요." onChange={handleChange} />
            </div>
            <div className="form-group">
              <label>주소</label>
              <input type="text" name="address" placeholder="주소를 입력하세요." onChange={handleChange} />
            </div>
          </div>

          {/* 로그인 정보 */}
          <div className="form-section">
            <h2>로그인 정보</h2>
            <div className="form-group">
              <label>아이디</label>
              <input type="text" name="username" placeholder="아이디를 입력하세요." onChange={handleChange} />
            </div>
            <div className="form-group">
              <label>비밀번호</label>
              <input type="password" name="password" placeholder="비밀번호를 입력하세요." onChange={handleChange} />
            </div>
            <div className="form-group">
              <label>비밀번호 확인</label>
              <input type="password" name="confirmPassword" placeholder="비밀번호를 다시 입력하세요." />
            </div>
          </div>

          <button type="submit" className="auth-button">회원가입</button>
        </form>
      </section>
    </div>
  );
};

export default Signup;
